// Dashboard.js
import React, { useState } from 'react';
import Profile from './Profile';
import FeePayment from './FeePayment';
import Attendance from './Attendance';
import Results from './Results';
import Courses from './Courses';
import Placements from './Placements';
import ExamTimeTable from './ExamTimeTable';
import AdmitCard from './AdmitCard';
import Grievances from './Grievances';
import TimeTable from './TimeTable';

function Dashboard({ onLogout }) {
  const [activeTab, setActiveTab] = useState('home');

  const announcements = [
    // ...existing announcements
  ];

  return (
    <div className="flex h-screen bg-gray-100">
      <div className="w-64 bg-white shadow-lg p-6">
        <h2 className="text-xl font-bold text-center mb-6">Dashboard</h2>
        <nav>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'home' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('home')}>Home</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'profile' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('profile')}>Profile</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'attendance' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('attendance')}>Attendance</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'results' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('results')}>Results</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'timetable' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('timetable')}>Time Table</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'calendar' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('calendar')}>Calendar of Events</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'courses' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('courses')}>Courses</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'placements' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('placements')}>Placements</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'grievances' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('grievances')}>Grievances</button>
          <button className={`block w-full text-left p-2 rounded hover:bg-gray-200 ${activeTab === 'feepayment' ? 'bg-gray-300' : ''}`} onClick={() => setActiveTab('feepayment')}>Fee Payment</button>
          <button className="mt-auto w-full text-left p-2 rounded bg-red-500 text-white hover:bg-red-600" onClick={onLogout}>Logout</button>
        </nav>
      </div>

      <div className="flex-grow p-6 overflow-y-auto">
        {(() => {
          switch (activeTab) {
            case 'home':
              return (
                <div className="bg-white p-4 rounded-lg shadow-md">
                  <h2 className="text-2xl font-semibold mb-4">Welcome to your Dashboard</h2>
                  <div className="bg-gray-100 p-4 rounded-lg shadow-inner">
                    <h3 className="text-xl font-bold mb-2">Latest Announcements</h3>
                    <ul className="list-disc pl-5">
                      {announcements.map((announcement, index) => (
                        <li key={index} className="mb-2">{announcement}</li>
                      ))}
                    </ul>
                  </div>
                </div>
              );
            case 'profile':
              return <Profile />;
            case 'attendance':
              return <Attendance />;
            case 'results':
              return <Results />;
            case 'timetable':
              return <TimeTable />;
            case 'calendar':
              return <ExamTimeTable />;
            case 'courses':
              return <Courses />;
            case 'placements':
              return <Placements />;
            case 'grievances':
              return <Grievances />;
            case 'feepayment':
              return <FeePayment />;
            default:
              return null;
          }
        })()}
      </div>
    </div>
  );
}

export default Dashboard;
